    const scrollToRef = (ref) => window.scrollTo(0, ref.current.offsetTop)
    const executeScroll = () => scrollToRef(myRef)
    const myRef = useRef(null)

    return ( 
            <div className = "App" >

                    <Switch>
                        <Route exact path="/">
                            <Header  executeScroll={this.executeScroll}/>

                            <Hero ref={props.refProp}/>

                            <Main/>
                            <div className="card-list__pc-background-container">  
                                <Cardlist/>

                                <Aboutmehome/>
                            </div> 
                            <Footer/>

                        </Route>

                        <Route exact path="/sobre-mi">
                                    <Header />
                                    <Aboutme/>
                                    <Footer/>
                        </Route>    

                        <Route exact path="/contacto">
                                    <Header />
                                    <Contact/>
                                    <Footer/>
                        </Route> 

                        <Route exact path="/testimonios">
                                    <Header />
                                    <Testimonies/>
                                    <Footer/>
                        </Route> 

                        <Route exact path="/consultas">
                                    <Header />
                                    <div className="card-list__pc-background-container__another-page">
                                        <Cardlist/>
                                        <Linktocontact/>
                                    </div>
                                    <Footer/>
                        </Route> 

                    </Switch>

            </div>
    )};





export default App;
